import './Box.css'
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';

function Box(props){


    return(
                    <div className="col-12 col-sm-12 col-md-6 col-lg-4 col-xl-3">
                        <div className="card borda ">
                            <div className="card-body ">
                                <img className="w-100 " src="CalcaVerde.jpg" alt="Roupa"/>
                                <h2 className="mt-2 ">{props.produto.nomeProduto}</h2>
                                <p>{props.produto.descProduto}</p>
                                <Link to="/ProdutoPag"
                                      nomeProduto={props.produto.nomeProduto}
                                      descProduto={props.produto.descProduto}
                                      preco={props.produto.preco}
                                      quantidade={props.produto.quantidade}
                                      categoria={props.produto.categoria}
                                      tamanho={props.produto.tamanho}>
                                    <button senha={props.produto.senha} 
                                              to="/ProdutoPag" 
                                              className="bota" 
                                              onClick={props.geral}>
                                    Comprar</button></Link>
                            </div>
                        </div>
                    </div>
    )
}

export default Box

